import React from 'react'

import { Component } from 'react'

class Nav extends Component {
    render() {
        return(
            <nav className='nav-wraper black' >
               <div className='container' >
                   <a style={{fontWeight:'300', fontSize:'30px'}} >UBISOFT</a>

                   <ul className='right' >
                       <a>Home</a>
                   </ul>

                   <ul className='btn right' style={{ marginTop:'20px'}} >
                        <a  >Hello</a>
                   </ul>
               </div>
            </nav>


        )
    }
}

export default Nav
